import React, { useState, useEffect } from 'react';

interface TrainingConfig {
    batchSize: number;
    epochs: number;
    learningRate: number;
    optimizer: string;
    lossFunction: string;
    validationSplit: number;
}

interface PropertiesPanelProps {
    initialConfig?: TrainingConfig;
    onConfigUpdate?: (config: TrainingConfig) => void;
}

const PropertiesPanel: React.FC<PropertiesPanelProps> = ({ 
    initialConfig,
    onConfigUpdate 
}) => {
    // Default training configuration
    const [trainingConfig, setTrainingConfig] = useState<TrainingConfig>(
        initialConfig || {
            batchSize: 32,
            epochs: 10,
            learningRate: 0.001,
            optimizer: 'adam',
            lossFunction: 'mse',
            validationSplit: 0.2
        }
    );

    // Update state when initialConfig changes
    useEffect(() => {
        if (initialConfig) {
            setTrainingConfig(initialConfig);
        }
    }, [initialConfig]);

    // Handle input changes
    const handleConfigChange = (key: keyof TrainingConfig, value: string | number) => {
        // Convert numeric inputs to numbers
        if (typeof trainingConfig[key] === 'number') {
            value = Number(value);
        }

        setTrainingConfig(prev => ({
            ...prev,
            [key]: value
        }));
    };

    // Handle saving configuration
    const handleSaveConfig = () => {
        // Notify parent component of the config update
        if (onConfigUpdate) {
            onConfigUpdate(trainingConfig);
        }

        // Show a temporary success message
        const successEl = document.getElementById('save-success');
        if (successEl) {
            successEl.style.opacity = '1';
            setTimeout(() => {
                successEl.style.opacity = '0';
            }, 2000);
        }
    };

    return (
        <div style={{ 
            width: 200, 
            border: '1px solid rgba(255, 255, 255, 0.1)', 
            padding: 16, 
            background: 'linear-gradient(135deg, #0f0f15 0%, #151520 100%)',
            color: '#ffffff',
            height: 'calc(100vh - 80px)',
            overflowY: 'auto',
            boxShadow: '0 4px 20px rgba(0, 0, 0, 0.2)'
        }}>
            <h3 style={{ 
                color: '#ffffff', 
                marginTop: 0,
                borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
                paddingBottom: '10px',
                fontWeight: 600,
                letterSpacing: '0.5px'
            }}>Training Options</h3>

            <div style={{
                marginTop: '12px',
                display: 'flex',
                flexDirection: 'column',
                gap: '16px'
            }}>
                {/* Batch Size */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Batch Size</label>
                    <input
                        type="number"
                        value={trainingConfig.batchSize}
                        onChange={(e) => handleConfigChange('batchSize', e.target.value)}
                        min="1"
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    />
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Number of samples per gradient update
                    </div>
                </div>

                {/* Epochs */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Epochs</label>
                    <input
                        type="number"
                        value={trainingConfig.epochs}
                        onChange={(e) => handleConfigChange('epochs', e.target.value)}
                        min="1"
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    />
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Number of complete passes through the dataset
                    </div>
                </div>

                {/* Learning Rate */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Learning Rate</label>
                    <input
                        type="number"
                        value={trainingConfig.learningRate}
                        onChange={(e) => handleConfigChange('learningRate', e.target.value)}
                        min="0.0001"
                        max="1"
                        step="0.0001"
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    />
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Step size for gradient descent optimization
                    </div>
                </div>

                {/* Optimizer */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Optimizer</label>
                    <select
                        value={trainingConfig.optimizer}
                        onChange={(e) => handleConfigChange('optimizer', e.target.value)}
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    >
                        <option value="adam">Adam</option>
                        <option value="sgd">SGD</option>
                        <option value="rmsprop">RMSprop</option>
                        <option value="adagrad">Adagrad</option>
                    </select>
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Algorithm to update model weights
                    </div>
                </div>

                {/* Loss Function */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Loss Function</label>
                    <select
                        value={trainingConfig.lossFunction}
                        onChange={(e) => handleConfigChange('lossFunction', e.target.value)}
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    >
                        <option value="mse">Mean Squared Error</option>
                        <option value="categorical_crossentropy">Categorical Crossentropy</option>
                        <option value="binary_crossentropy">Binary Crossentropy</option>
                        <option value="sparse_categorical_crossentropy">Sparse Categorical Crossentropy</option>
                    </select>
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Function to measure model's performance
                    </div>
                </div>

                {/* Validation Split */}
                <div className="training-option">
                    <label style={{
                        display: 'block',
                        marginBottom: '6px',
                        color: '#b0b8c4',
                        fontSize: '14px',
                        fontWeight: 500
                    }}>Validation Split</label>
                    <input
                        type="number"
                        value={trainingConfig.validationSplit}
                        onChange={(e) => handleConfigChange('validationSplit', e.target.value)}
                        min="0"
                        max="0.5"
                        step="0.01"
                        style={{
                            width: '100%',
                            padding: '8px 10px',
                            background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)',
                            borderRadius: '8px',
                            color: 'white',
                            fontSize: '14px',
                            outline: 'none'
                        }}
                    />
                    <div style={{ 
                        fontSize: '12px', 
                        color: '#8a9db8', 
                        marginTop: '4px' 
                    }}>
                        Fraction of data used for validation (0.0 to 0.5)
                    </div>
                </div>

                {/* Save Button */}
                <button
                    onClick={handleSaveConfig}
                    style={{
                        marginTop: '10px',
                        padding: '10px 16px',
                        background: 'linear-gradient(135deg, #4776E6 0%, #8E54E9 100%)',
                        border: 'none',
                        borderRadius: '8px',
                        color: 'white',
                        fontWeight: 600,
                        cursor: 'pointer',
                        transition: 'all 0.3s ease',
                        boxShadow: '0 2px 10px rgba(71, 118, 230, 0.3)',
                    }}
                    onMouseOver={(e) => {
                        e.currentTarget.style.transform = 'translateY(-2px)';
                        e.currentTarget.style.boxShadow = '0 4px 15px rgba(71, 118, 230, 0.4)';
                    }}
                    onMouseOut={(e) => {
                        e.currentTarget.style.transform = 'translateY(0)';
                        e.currentTarget.style.boxShadow = '0 2px 10px rgba(71, 118, 230, 0.3)';
                    }}
                >
                    Apply Settings
                </button>

                {/* Success message */}
                <div 
                    id="save-success"
                    style={{
                        marginTop: '8px',
                        padding: '8px 12px',
                        background: 'linear-gradient(90deg, #00b09b 0%, #96c93d 100%)',
                        borderRadius: '6px',
                        color: 'white',
                        fontSize: '13px',
                        textAlign: 'center',
                        opacity: 0,
                        transition: 'opacity 0.3s ease'
                    }}
                >
                    Settings applied successfully!
                </div>
            </div>
        </div>
    );
};

export default PropertiesPanel;
